import React, { useState, useEffect } from 'react';
import { setDayOrderReference, getDayOrderReferences } from '../services/api';
import './AdminDayOrder.css';

const AdminDayOrder = ({ adminEmail }) => {
  const [referenceDate, setReferenceDate] = useState('');
  const [dayOrder, setDayOrder] = useState('');
  const [references, setReferences] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  useEffect(() => {
    fetchReferences();
  }, [adminEmail]);

  const fetchReferences = async () => {
    try {
      setLoading(true);
      const data = await getDayOrderReferences(adminEmail);
      setReferences(data);
    } catch (error) {
      setError('Failed to fetch day order references');
      console.error('Error fetching references:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);
      setError('');
      setSuccess('');

      await setDayOrderReference(adminEmail, referenceDate, parseInt(dayOrder));
      
      // Clear form and show success message
      setReferenceDate('');
      setDayOrder('');
      setSuccess('Day order reference set successfully!');
      
      // Refresh the references list
      fetchReferences();
    } catch (error) {
      setError(error.message || 'Failed to set day order reference');
      console.error('Error setting reference:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="admin-day-order">
      <h3>Set Day Order Reference</h3>
      
      {error && <div className="error-message">{error}</div>}
      {success && <div className="success-message">{success}</div>}
      
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="referenceDate">Reference Date:</label>
          <input
            type="date"
            id="referenceDate"
            value={referenceDate}
            onChange={(e) => setReferenceDate(e.target.value)}
            required
          />
        </div>
        
        <div className="form-group">
          <label htmlFor="dayOrder">Day Order:</label>
          <select
            id="dayOrder"
            value={dayOrder}
            onChange={(e) => setDayOrder(e.target.value)}
            required
          >
            <option value="">Select Day Order</option>
            <option value="1">1</option>
            <option value="2">2</option>
            <option value="3">3</option>
            <option value="4">4</option>
            <option value="5">5</option>
          </select>
        </div>
        
        <button type="submit" disabled={loading}>
          {loading ? 'Setting...' : 'Set Day Order Reference'}
        </button>
      </form>

      <div className="references-history">
        <h4>Day Order Reference History</h4>
        {loading && <div className="loading">Loading references...</div>}
        {references.length > 0 ? (
          <table>
            <thead>
              <tr>
                <th>Date</th>
                <th>Day Order</th>
                <th>Set By</th>
                <th>Created At</th>
              </tr>
            </thead>
            <tbody>
              {references.map((ref, index) => (
                <tr key={index}>
                  <td>{new Date(ref.reference_date).toLocaleDateString()}</td>
                  <td>{ref.day_order}</td>
                  <td>{ref.set_by}</td>
                  <td>{new Date(ref.created_at).toLocaleString()}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p className="no-references">No day order references found.</p>
        )}
      </div>
    </div>
  );
};

export default AdminDayOrder;
